$\textbf{Juanの古い切手の収集場所}$

Juanは彼のコレクションの切手を国別と発行された年代別に整理しています。彼が切手店で支払った価格は、ブラジルとフランスがそれぞれ$6$セント、ペルーが$4$セント、スペインが$5$セントでした。（ブラジルとペルーは南アメリカの国で、フランスとスペインはヨーロッパにあります。）[asy]
/* AMC8 2002 #8, 9, 10 Problem */
size(3inch, 1.5inch);
for ( int y = 0; y <= 5; ++y )
{

draw((0,y)--(18,y));
}
draw((0,0)--(0,5));
draw((6,0)--(6,5));
draw((9,0)--(9,5));
